vector<int> maximum_independent_set(vector<bitset<NN>> bit, int trial = 30000) {
    int N = num_nodes;
    vector<int> ord(N);
    iota(begin(ord), end(ord), 0);
    int ret = 0;
    bitset<NN> ver;
    for (int i = 0; i < trial; i++) {
        shuffle_vector(ord, rnd);
        bitset<NN> used;
        int add = 0;
        for (int j : ord) {
            if ((used & bit[j]).count()) continue;
            used[j] = true;
            ++add;
        }
        if (ret < add) {
            ret = add;
            ver = used;
        }
    }
    vector< int > ans;
    for (int i = 0; i < N; i++) {
        if (ver[i]) ans.emplace_back(i);
    }
    return ans;
}

